    false,nt"url": null,nt"notes": "A spring aerial survey of the Nowitna River
    corridor was conducted to determine density and distribution of geese. Totals observed
    were 273 white-fronted geese in 30 flocks and 7 Canada geese in 3 flocks. The number
    of white-fronted geese declined by 48.0% from 1986 on a portion of the survey route
    surveyed both years. Goose production data were collected during the Nowitna MR
    annual waterfowl brood survey. Totals of 89 adult and 119 juvenile white-fronted
    geese were observed on the lower Nowitna River, and 35 adult and 29 juvenile white-fronted
    were observed on the Sulatna River. Three hundred and eight white-fronted geese
    were observed on surveyed wetlands.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
